import React from 'react';

import Card from '../UI/Card/Card';
import Input from '../UI/Input/Input';

const AddUser = () => {
    return (
        <Card>
        <Input
              id="email"
              label="Email"
              type="text"
             
            />
        <button>Register</button>
        </Card>
    )
}

export default AddUser;
